('O rabba main to mar gya', 'Shahid Mallya', 'Mausam', 'Koi Dil Bekabu Kar Gaya\nAur Ishqa Dil Mein Bhar Gaya\nKoi Dil Bekabu Kar Gaya\nAur Ishqa Dil Mein Bhar Gaya\n\nAankhon , Aankhon Mein Woh Lakho Gala Kar Gaya Oye\nO Rabbba Mein To Mar Gaya Oye\nShadai Mujhe Kar Gaya Kar Gaya Oye\nLyricsmasti.Com\nO Rabbba Mein To Mar Gaya Oye\nShadai Mujhe Kar Gaya Kar Gaya Oye\n\nAbb Dil Chahe Khamoshi Ke Hoonthon Pe Mein Likh Dun\nPyaari Se Baatein Kai\nHo Kuch Pal Mere Naam Karein Woh \nMain Bhi Uske Naam Pe Likhon Mulakatein Kai\n\nO Pheli Hi Takni Mein Ban Gai Jaan Mein \nNaina Waina Uske Mere Dil Pe Chape\nAbb Jaun Kahan Pe Dil Ruka Hai Wahan Pe\nJahan Dekh Ke Mujhe Woh Aaghe Badh Gaya Oye\n\nO Rabbba Mein To Mar Gaya Oye\nShadai Mujhe Kar Gaya Oye\nLyricsMAsti.Com\nO Rabbba Mein To Mar Gaya Oye\nShadai Mujhe Kar Gaya Oye\n\nMausam Ke Aazad Pariende \nHaathon Mein Hai Uske \nYa Woh Baharon Si Hai\nSardi Ki Woh Dhoop Ke Jaise\nGarmi Ki Shaam Hai\nPheli Fuhaaron Si Hai\n\nMere Pyaar Ka Mausam Bhi Hai\nLage Meri Mehram Bhi Hai\n\nMere Pyaar Ka Mausam Bhi Hai\nLage Meri Mehram Bhi Hai\n\nJaane Kya Kya Do Aankhon Mein Mein Padh Gaya Woh\n\nO Rabbba Mein To Mar Gaya Oye\nShadai Mujhe Kar Gaya Oye\nLyricsMAsti.Com\nO Rabbba Mein To Mar Gaya Oye\nShadai Mujhe Kar Gaya Oye\n\nKoi Dil Bekabu Kar Gaya\nAur Ishqa Dil Mein Bhar Gaya\n\nAankhon , Aankhon Mein Woh Lakho Gala Kar Gaya Oye\nO Rabbba Mein To Mar Gaya Oye\nShadai Mujhe Kar Gaya Kar Gaya Oye\nLyricsmasti.Com\nO Rabbba Mein To Mar Gaya Oye\nShadai Mujhe Kar Gaya Kar Gaya Oye', '', '', ''),
('Teri meri', 'Rahat Fateh Ali Khan, Shreya Ghoshal', 'Bodyguard', 'Aa ..\n\nTeri Meri, Meri Teri Prem Kahani Hai Mushkil\nDo Lafzon Mein Yeh Bayaan Na Ho Paaye\nIk Ladka, Ik Ladki Ki Yeh Kahani Hai Nayi\nDo Lafzon Mein Yeh Bayaan Na Ho Paaye\n\nTeri Meri, Meri Teri Prem Kahani Hai Mushkil\nDo Lafzon Mein Yeh Bayaan Na Ho Paaye\nIk Dooje Se Hue Judaa, Jab Ik Dooje Ke Liye Bane\nTeri Meri, Meri Teri Prem Kahani Hai Mushkil\nDo Lafzon Mein Yeh Bayaan Na Ho Paaye\nAa ..\n\nTumse Dil Jo Lagaya, Toh Jahaan Maine Paaya\nKabhi Socha Na Tha Yun, Meelon Door Hoga Saaya\nKyun Khuda Tune Mujhe Aisa Khwaab Dikhaya\nJab Haqeeqat Mein Usse Todna Tha\nAa ..\n\nIk Dooje Se Hue Judaa, Jab Ik Dooje Ke Liye Bane\nTeri Meri, Meri Teri Prem Kahani Hai Mushkil\nDo Lafzon Mein Yeh Bayaan Na Ho Paaye\n\nTeri Meri Baaton Ka Har Lamha Sab Se Rangjaana\nDo Lafzon Mein Yeh Bayaan Na Ho Paaye\nHar Ehsaas Mein Tu Hai, Har Ik Yaad Mein Tera Afsaana\nDo Lafzon Mein Yeh Bayaan Na Ho Paaye\n\nAa ..\n\nSaara Din Bit Jaaye, Saari Raat Jagaaye\nBas Khayal Tumhara, Lamha Lamha Tadpaaye\nYeh Tadap Keh Rahi Hai Mit Jaaye Faasle\nYeh Tere Mere Darmeyaan Hai Jo Saare\n\nIk Dooje Se Hue Judaa Jab Ik Dooje Ke Liye Bane\nTeri Meri Baaton Ka Har Lamha Sab Se Anjaana\nDo Lafzon Mein Yeh Bayaan Na Ho Paaye\nHar Ehsaas Mein Tu Hai Har Ik Yaad Mein Tera Afsaana\nDo Lafzon Mein Yeh Bayaan Na Ho Paaye\n\nTeri Meri, Meri Teri Prem Kahani Hai Mushkil\nDo Lafzon Mein Yeh Bayaan Na Ho Paaye', '', '', ''),
('Laag gale sunn bintee meri', 'Bhai lakhwinder singh ji', '', 'Laag gale sunn bintee meri\nKarvat bhala na karvatt teri \nLaag gale sunn bintee meri\n\nHoun vaari mukh pher piyaare \nKarvatt de mau kau kaahe ko maare\nLaag gale sunn bintee meri\n\nJau tann cheerae ang na moro \nPind parae toh preet na todo\nLaag gale sunn bintee meri\n\nHum tum beech bhayo nahi koi\nTumhe so kant naar hum soi\nLaag gale sunn bintee meri\nKarvat bhala na karvatt teri \nLaag gale sunn bintee meri\n\nKehet kabir suno re loi\nAb tumri parteet na hoi\nLaag gale sunn bintee meri\nKarvat bhala na karvatt teri \nLaag gale sunn bintee meri', '', '', ''),
('ram simar ', 'Bhai Harjinder Singh', 'simar', 'ਕਬੀਰੁ ॥ ਮਾਰੂ ॥\r\nकबीरु ॥ मारू ॥\r\n\r\nਰਾਮੁ ਸਿਮਰੁ ਪਛੁਤਾਹਿਗਾ ਮਨ ॥\r\nरामु सिमरु पछुताहिगा मन ॥\r\n\r\nਪਾਪੀ ਜੀਅਰਾ ਲੋਭੁ ਕਰਤੁ ਹੈ ਆਜੁ ਕਾਲਿ ਉਠਿ ਜਾਹਿਗਾ ॥੧॥ ਰਹਾਉ ॥\r\nपापी जीअरा लोभु करतु है आजु कालि उठि जाहिगा ॥१॥ रहाउ ॥\r\n\r\nਲਾਲਚ ਲਾਗੇ ਜਨਮੁ ਗਵਾਇਆ ਮਾਇਆ ਭਰਮ ਭੁਲਾਹਿਗਾ ॥\r\nलालच लागे जनमु गवाइआ माइआ भरम भुलाहिगा ॥\r\n\r\nਧਨ ਜੋਬਨ ਕਾ ਗਰਬੁ ਨ ਕੀਜੈ ਕਾਗਦ ਜਿਉ ਗਲਿ ਜਾਹਿਗਾ ॥੧॥\r\nधन जोबन का गरबु न कीजै कागद जिउ गलि जाहिगा ॥१॥\r\n\r\nਜਉ ਜਮੁ ਆਇ ਕੇਸ ਗਹਿ ਪਟਕੈ ਤਾ ਦਿਨ ਕਿਛੁ ਨ ਬਸਾਹਿਗਾ ॥\r\nजउ जमु आइ केस गहि पटकै ता दिन किछु न बसाहिगा ॥\r\n\r\nਸਿਮਰਨੁ ਭਜਨੁ ਦਇਆ ਨਹੀ ਕੀਨੀ ਤਉ ਮੁਖਿ ਚੋਟਾ ਖਾਹਿਗਾ ॥੨॥\r\nसिमरनु भजनु दइआ नही कीनी तउ मुखि चोटा खाहिगा ॥२॥\r\n\r\nਧਰਮ ਰਾਇ ਜਬ ਲੇਖਾ ਮਾਗੈ ਕਿਆ ਮੁਖੁ ਲੈ ਕੈ ਜਾਹਿਗਾ ॥\r\nधरम राइ जब लेखा मागै किआ मुखु लै कै जाहिगा ॥\r\n\r\nਕਹਤੁ ਕਬੀਰੁ ਸੁਨਹੁ ਰੇ ਸੰਤਹੁ ਸਾਧਸੰਗਤਿ ਤਰਿ ਜਾਂਹਿਗਾ ॥੩॥੧॥\r\nकहतु कबीरु सुनहु रे संतहु साधसंगति तरि जांहिगा ॥३॥१॥', '', 'Baljeet Singh', ''),
('Tashan Mein', 'Master Saleem', 'Tashan', '[Heyyy Tali Bajawe Naache Gaawe\nHey Tali Bajawe Naache Gaawe\n\nRab Howe Sarik Jeene Ke Jasan Mein\n]2\n\n\nApni To Baat Magar Kuch Nirali Hai\nApne To Khoon Mein Ishq Ki Lali Hai\nHo Apna Jeena To Jeena\n\nTashan Mein Tashan Mein\nTashan Mein Tashan Mein \n\nDhoop Tashan Hai\nRaat Tashan Hai\nApni To Har Bath Tashan Hai\nKaise Bhi Halat Tashan Hai\nWaise Insaan Hai\nLyricSMasti.Com\nTede Apne Karam Hue Hai\nHum Suraj Pe Garam Hue Hai\nKabhi Sharam Be Sharam Huye Hai\n\nThode Naadan Hai\n[Humpe Hai Rahe Teer Sikandar Ka\nHumpe Kurban Ha Neel Samundar Ka]2\n\nHum Jaise Hai\nKismat Ke Lakh Sawari Hai\nApni Tho Baat Magar Kuch Nirali Hai\nHoi Apna Jeena To Jeena\n\n[Tashan Mein Tashan Mein\nTashan Mein Tashan Mein ]\n\n[Tali Bajawe Naache Gaawe\nHey Tali Bajawe Naache Gaawe] \n\nRab Howe Sarik Jeene Ke Jasan Mein 2\nLyricSMasti.Com\nApni To Baat Margar Kuch Nirali Hai\nApne To Khoon Mein Ishq Ki Lali Hai\nHo Apna Jeena To Jeena\n\nTashan Mein Tashan Mein\nTashan Mein Tashan Mein', '', 'Baljeet Singh', ''),
('Kya wajah thi tere jaane ki', 'Javed Ali', '5 Ghantey Mein 5 Crore', 'Kya wajah thi tere jaane ki\nphir laut ke na aane ki\nkya wajah thi tere jaane ki\nphir laut ke na aane ki\naayee hai hawayein tujhe hai bulayein\nYaad bulayein..\n\nKya wajah thi tere jaane ki\nphir laut ke na aane ki\nkya wajah thi tere jaane ki\nphir laut ke na aane ki…\n\nYaad jo aaye tujhe hai bulayein\nkuch na khabar hai tere aane ki\nphir laut ke na aane ki\nkya wajah thi tere jaane ki\nphir laut ke na aane ki\nsaiyyaaannn\naie saiyaaaaaan\nsaiyyaaannn…\n\nKitne mausam gujre hai\nhum yaad mein teri tadpe hai\nchandni aa ke kehti hai\naate jaate kehti hai\nkitne mausam gujre hai\nhum yaad mein teri tadpe hai\nchandni aa ke kehti hai\naate jaate kehti hai\nhaaaan de de sahara\nbas ek nazara\nkab tak yun tadpayega\nkya wajah thi pyaar jatane ki\nphir laut ke na aane ki…\n\nHmmm itna bhi na socha tumne\nbaad tumhare jaane ke\nhum kaise jeeyenge\njaane jaan\nnahi jeena mar jayenge\nitna bhi na socha tumne\nbaad tumhare jaane ke\nhum kaise jeeyenge\njaane jaan…\n\nNahi jeena mar jayenge\nsocho kya hoga hamara\ndil ne hai pukara\nbin tere nahin jee payenge\nkya wajah thi khwab dikhane ki\nphir laut ke na aane ki…\n\nKya wajah thi khwab dikhane ki\nphir laut ke na aane ki\nkya wajah thi tere jaane ki\nphir laut ke na aane ki', '', 'Baljeet Singh', ''),
('Dooja Saah', 'Nachattar Gill', 'Akhiyan Ch Paani', 'Tera naam dheauni aan, ve channa tenu chauni aan\nMain tera naam dheauni aan, bas tenu chauni aan\nTenu kinna pyaar kara, \nBol ke daseya jaave na, bol ke daseya jaave na\nIk pal je mukh moddan, te dooja saah vi aave na\nIk pal je mukh moddan, te dooja saah vi aave na\nMain tera naam dheauni aan, te channa tenu chauni aan\n\nAkhiyan saave rehna ae tu, dil mere vich vasda ae\nMain kamli jad ro paindi haan, gal naal la ke hassda ae\nSacch aakhan saunh teri,\nVe rab kade jhooth bulaave na\nVe rab kade jhooth bulaave na\nIk pal je mukh moddan, te dooja saah vi aave na\nIk pal je mukh moddan, te dooja saah vi aave na\nMain tera naam dheauni aan, te channa tenu chauni aan\n\nTu jad kade bulauna mainu, keh ke dil di rani ve\nJeondiyan vich phir, ho jaandi haan, sacchi main marjaani ve\nTere supne laindi nu, \nVe mainu koi jagave na, ve mainu koi jagave na\nIk pal je mukh moddan, te dooja saah vi aave na\nIk pal je mukh moddan, te dooja saah vi aave na\nMain tera naam dheauni aan, bas tenu chauni aan\n\nve channa tenu chauni aan\nke channa tenu chauni aan\nBas tenu chauni aan............', '', 'Baljeet Singh', '');

